import "./App.css";
import Todos from "./components/Todos";
import Todo from "./models/todo";
function App() {
  const todos = [new Todo("Learn Maths"), new Todo("Learn Economics")];

  return (
    <div>
      <Todos items={todos} />
    </div>
  );
}

export default App;
